-- ----------------------------
-- View structure for BASE_USER_VIEW
-- ----------------------------
CREATE OR REPLACE FORCE VIEW "NCTS_LEGO"."BASE_USER_VIEW" AS 
SELECT   tu.ID AS ID,
            tu.REAL_NAME AS REAL_NAME,
            tu.AVATAR AS AVATAR,
            tu.PAPERWORK_NO AS PAPERWORK_NO,
            tu.STAGE AS STAGE,
            tu.SUBJECT AS SUBJECT,
            tu.PHONE AS PHONE,
            tu.EMAIL AS EMAIL,
            ta.USER_NAME AS USER_NAME,
            ta.PASSWORD AS PASSWORD,
            ta.ROLE_CODE AS ROLE_CODE,
            ta.STATE AS STATE,
            (case when TA.ROLE_CODE = '2' then d.dept_name else '广东第二师范学院网络教育学院' end) AS DEPT_NAME,
            (case when TA.ROLE_CODE = '2' then d.id else 'lego_train_manage_dept' end) DEPT_ID,
            tu.ID AS USER_ID,
            '' AS AREA_ID,
						tu.SUMMARY,
            ur.PROVINCE,
            ur.CITY,
            ur.COUNTIES
     FROM   user_info tu
                         JOIN
                            account ta
                         ON tu.ID = ta.USER_ID
                               AND ta.IS_DELETED = 'N'
                         left join USER_DEPT ud
on ud.user_id = tu.id
left join department d
on d.id = ud.dept_id
left join user_regions ur
on ur.user_id = TU.id
    WHERE   tu.IS_DELETED = 'N';

-- ----------------------------
-- View structure for TEMP_USER
-- ----------------------------
CREATE OR REPLACE FORCE VIEW "NCTS_LEGO"."TEMP_USER" AS 
SELECT UV."ID",UV."USER_NAME",UV."PASSWORD",UV."ROLE_CODE",UV."PAPERWORK_NO",UV."REAL_NAME",UV."DEPT_ID",UV."DEPT_NAME",UV."DEPT_LEVEL",UV."DEPT_TYPE",UV."PARENT_ID",UV."PROVINCE",UV."CITY",UV."COUNTIES",UV."AVATAR",UV."MOBILE_PHONE",UV."EMAIL",UV."PASSWORD_PLAIN",UV."DATA_POSITION",UV."CREATOR",UV."CREATE_TIME",UV."UPDATEDBY",UV."UPDATE_TIME",UV."VERSION",UV."IS_DELETED",UV."SEX"
FROM ITLMS_LEGO.USERVIEW UV
LEFT JOIN ITLMS_LEGO.IPANTHER_USER_TEACHER IUT
ON IUT.USER_ID = UV.ID
AND IUT.IS_DELETED = 'N' 
WHERE EXISTS (SELECT 1 FROM ITLMS_LEGO.LEGO_TERM_USER LTU WHERE UV.ID = LTU.USER_ID AND LTU.IS_DELETED = 'N' and LTU.STATUS = '02'
AND EXISTS (SELECT 1 FROM ITLMS_LEGO.LEGO_TERM LT WHERE LTU.TERM_ID = LT.ID AND LT.IS_DELETED = 'N'
--AND TO_NUMBER(to_char(LT.REG_START_TIME, 'yyyy')) >= 2016
));

-- ----------------------------
-- View structure for VIEW_REGIONS
-- ----------------------------
CREATE OR REPLACE FORCE VIEW "NCTS_LEGO"."VIEW_REGIONS" AS 
SELECT
	"ID","REGIONS_CODE","REGIONS_NAME","PARENT_CODE","REGIONS_LEVEL","CREATOR","CREATE_TIME","UPDATEDBY","UPDATE_TIME","IS_DELETED","VERSION"
FROM
	ITLMS_LEGO.IPANTHER_ADMIN_REGIONS
WHERE
	REGIONS_CODE = '440000'
OR PARENT_CODE = '440000'
OR PARENT_CODE IN (
	SELECT
		REGIONS_CODE
	FROM
		ITLMS_LEGO.IPANTHER_ADMIN_REGIONS
	WHERE
		PARENT_CODE = '440000'
);

-- ----------------------------
-- Procedure structure for SYNC_USER_AND_TRAIN_REGISTER
-- ----------------------------
CREATE OR REPLACE PROCEDURE "NCTS_LEGO"."SYNC_USER_AND_TRAIN_REGISTER"
(
    TERM_ID_PARAM IN VARCHAR2
) IS
insertNum number; 
BEGIN
    SELECT T.ID, T.REAL_NAME, T.PAPERWORK_NO, T.MOBILE_PHONE, (sysdate- to_date('1970-01-01','yyyy-mm-dd'))* 24*60*60*1000, 'admin','N', 1 
    FROM NCTS_LEGO.TEMP_USER T
    WHERE NOT EXISTS (SELECT 1 FROM NCTS_LEGO.USER_INFO WHERE PAPERWORK_NO = T.PAPERWORK_NO)
    AND NOT EXISTS (SELECT 1 FROM NCTS_LEGO.USER_INFO WHERE ID = T.ID)
    AND EXISTS (SELECT 1 FROM LEGO_TERM_USER LTU WHERE UV.ID = LTU.USER_ID AND LTU.IS_DELETED = 'N' and LTU.STATUS = '02'
    AND EXISTS (SELECT 1 FROM ITLMS_LEGO.LEGO_TERM LT WHERE LTU.TERM_ID = LT.ID AND LT.ID = TERM_ID_PARAM));
    insertNum := sql%rowcount;
    dbms_output.put_line(insertNum);

    SELECT SYS_GUID(), T.USER_NAME, T.PASSWORD, 2,ID, (sysdate- to_date('1970-01-01','yyyy-mm-dd'))* 24*60*60*1000, 'admin','N', 1 
    FROM NCTS_LEGO.TEMP_USER T
    WHERE (EXISTS (SELECT 1 FROM NCTS_LEGO.USER_INFO WHERE PAPERWORK_NO = T.PAPERWORK_NO)
    OR EXISTS (SELECT 1 FROM NCTS_LEGO.USER_INFO WHERE ID = T.ID))
    AND NOT EXISTS (SELECT 1 FROM NCTS_LEGO.ACCOUNT A WHERE A.USER_ID = T.ID)
    AND EXISTS (SELECT 1 FROM LEGO_TERM_USER LTU WHERE UV.ID = LTU.USER_ID AND LTU.IS_DELETED = 'N' and LTU.STATUS = '02'
    AND EXISTS (SELECT 1 FROM ITLMS_LEGO.LEGO_TERM LT WHERE LTU.TERM_ID = LT.ID AND LT.ID = TERM_ID_PARAM));
    insertNum := sql%rowcount;
    dbms_output.put_line(insertNum);

    SELECT
    MD5(DEPT_NAME) ID ,
    DEPT_NAME,
    (sysdate - to_date('1970-01-01','yyyy-mm-dd'))* 24*60*60*1000 ,
    'admin','N', 1 
    from
    (SELECT DEPT_NAME
    from ITLMS_LEGO.USERVIEW BUV
    GROUP BY DEPT_NAME) TMP
    WHERE DEPT_NAME IS NOT NULL
    AND NOT EXISTS (SELECT 1 FROM NCTS_LEGO.DEPARTMENT WHERE TMP.DEPT_NAME = DEPT_NAME);
    insertNum := sql%rowcount;
    dbms_output.put_line(insertNum);
    
    SELECT SYS_GUID(), ID, (SELECT ID FROM NCTS_LEGO.DEPARTMENT WHERE DEPT_NAME = T.DEPT_NAME) 
    FROM NCTS_LEGO.TEMP_USER T
    WHERE EXISTS (SELECT 1 FROM NCTS_LEGO.DEPARTMENT WHERE DEPT_NAME = T.DEPT_NAME)
    and EXISTS (SELECT 1 FROM NCTS_LEGO.USER_INFO WHERE PAPERWORK_NO = T.PAPERWORK_NO)
    and not exists (select 1 from NCTS_LEGO.USER_DEPT where user_id = t.id);
    insertNum := sql%rowcount;
    dbms_output.put_line(insertNum);

    SELECT SYS_GUID(), TT.TRAIN_ID, T.ID, 'pass', (sysdate- to_date('1970-01-01','yyyy-mm-dd'))* 24*60*60*1000, 'admin', 'N', 1
    FROM NCTS_LEGO.TEMP_USER T
    JOIN NCTS_LEGO.TRAIN_TERM TT
    ON T.TERM_ID = TT.TERM_ID
    AND TT.TERM_ID = TERM_ID_PARAM
    WHERE (EXISTS (SELECT 1 FROM NCTS_LEGO.USER_INFO WHERE PAPERWORK_NO = T.PAPERWORK_NO)
    OR EXISTS (SELECT 1 FROM NCTS_LEGO.USER_INFO WHERE ID = T.ID))
    AND NOT EXISTS (SELECT 1 FROM NCTS_LEGO.TRAIN_REGISTER WHERE USER_ID = T."ID" AND TRAIN_ID = TT.TRAIN_ID);
    insertNum := sql%rowcount;
    dbms_output.put_line(insertNum);

END; 
/

-- ----------------------------
-- Function structure for MD5
-- ----------------------------
CREATE OR REPLACE FUNCTION "NCTS_LEGO"."MD5"(
passwd IN VARCHAR2)
RETURN VARCHAR2
IS
retval varchar2(32);
BEGIN
retval := utl_raw.cast_to_raw(DBMS_OBFUSCATION_TOOLKIT.MD5(INPUT_STRING => passwd)) ;
RETURN retval;
END;
/

