DROP SEQUENCE "NCTS_LEGO"."DBOBJECTID_SEQUENCE";
CREATE SEQUENCE "NCTS_LEGO"."DBOBJECTID_SEQUENCE"
 INCREMENT BY 50
 MINVALUE 1
 MAXVALUE 999999999999999999999999
 START WITH 757501
 CACHE 50;

